import type { Subscription, WebhookTargetType, WebsocketTargetType } from "./subscription.interface";
export interface DataStream<TFilters extends any> {
    readonly id: string | undefined;
    dateCreated?: Date | undefined;
    dateLastUpdated?: Date | undefined;
    filters?: Partial<TFilters>;
    name?: string | undefined;
    subscriptionId?: string | undefined;
    target?: WebhookTargetType | WebsocketTargetType;
    apiKey?: string | null;
    toSubscription(excludeRuleType?: boolean): Omit<Subscription, "dateCreated" | "dateLastUpdated">;
}
